import React from 'react'
class Movie1 extends React.Component{
    m_name="Deadpool"
    h_name="reylond"
    render(){
        return <div>
            <h1>Movie_name:{this.m_name}{{color:"red"}}</h1>
            <h2>Hero_name:{this.h_name}</h2>
        </div>
    }
}
export default Movie1
